import React, { useEffect } from "react";
import './App.css';
import {audioVisualizer, headerAnimation} from './section_script/sectionScripts.js'

function App() {

  useEffect(() => {
    headerAnimation();
  }, []);

  return (

    <div className="App">
      <header className="App-header"><h1 id="App-header-title" style={{ opacity: 0, fontSize: '1px', transition: 'opacity ease 0.5s, font-size ease 0.5s' }}></h1></header>
    </div>
  );
}

export default App;
